       <header /> 
      <ul>
        <li>css</li>
        <li>html</li>
        <li>js</li>
        <li>react</li>
      </ul>
    </div>
  );
}

const  header = () => {
  return (
    <div className="App">
      <div> one dive </div>
      <ul>
        <li>home</li>
        <li>page</li>
        <li>test</li>
        <li>react</li>
      </ul>
    </div>
  );
}

export default App;
